import React from 'react'
import { Paper, Table, TableCell, TableContainer, TableHead, TableRow } from '@mui/material'
import './historyy1.css'

function Historyy1() {

  const [responseStatus, setResponseStatus] = useState(0);
  const [responseMessage, setResponseMessage] = useState('');

  useEffect(() => {
    async function fetchData() {
      try {
        const response = await axios.get('http://127.0.0.1:5000/get_consultations', {
          params: { cin: cin },
          headers: {
            'Content-Type': 'application/json'
          }
        });

        const data = response.data;
        console.log(data);
        setResponseMessage(data.message);

        if (response.status === 201) {
          setFormData({
            cin: data.cin_personnel,
            name: data.full_name,
            date: new Date(data.date_of_birth).toISOString().slice(0, 10),
            tel: data.phone_number,
            email: data.email,
            password: data.password
          });
          setResponseStatus(response.status);
          console.log("Success:", data);
        } else {
          console.error("Failure:", data);
        }
      } catch (error) {
        console.error("Error during the request:", error.message);
      }
    }

    fetchData();
  }, []);


  return (
    <div >
      <h2 id='history1'>History of Patients</h2>

      <form className="serchConsu1">
        <h4>Find consultations of patient:</h4>
        <div className="row2">
          <input type="text" name="cin" placeholder="CIN" required />
          <button type="submit">Search</button>
        </div>
      </form>

      <Paper sx={{width: '95%', marginLeft: '2%'}}>
        <TableContainer>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>consultation_id</TableCell>
                <TableCell>cin_patient</TableCell>
                <TableCell>date_consultation</TableCell>
                <TableCell>Arrival mode</TableCell>
                <TableCell>Injury</TableCell>
                <TableCell>Mental</TableCell>
                <TableCell>Pain</TableCell>
                <TableCell>NRS_pain</TableCell>
                <TableCell>SBP</TableCell>
                <TableCell>DBP</TableCell>
                <TableCell>HR</TableCell>
                <TableCell>RR</TableCell>
                <TableCell>BT</TableCell>
                <TableCell>Saturation</TableCell>
                <TableCell>diagnostic</TableCell>
              </TableRow>
            </TableHead>
          </Table>
        </TableContainer>
      </Paper>
    </div>
  )
}

export default Historyy1
